O App oficial dos cartões Ticket®, traz uma experiência totalmente nova!

O que já era bom, ficou ainda melhor! Você pode consultar o saldo do seu cartão, extrato, sugestão de gasto médio diário, ver toda a rede credenciada que aceita Ticket, ter acesso a vantagens exclusivas e cupons de desconto para usuários Ticket e, ainda, realizar o autoatendimento e gestão do seu benefício direto pelo App, como: alteração de senha do cartão, bloqueio, reemissão e muito mais, de forma simples e prática!

Além disso, agora você também pode criar sua lista de compras com seu Ticket Alimentação para não esquecer de nenhum item na hora das compras, saber de um jeito muito mais fácil e rápido tudo que acontece no universo Ticket, vantagens exclusivas, promoções ou só usufruir de um app bem mais leve!

Cadastre seus cartões:
• Ticket Restaurante®;
• Ticket Alimentação®;
• Ticket Alimentação Natal®.
• Ticket Flex®.
• Ticket Transporte®.
• Ticket Cultura®;
• Ticket Plus®;
• Ticket Car®;
• Ticket Saúde®.

• Por questões de segurança, e para o desenvolvimento de melhorias e novos serviços para você, o cadastro no App Ticket é obrigatório, além de trazer mais segurança traz maior conforto no acesso e consulta dos cartões, ao salvá-los automaticamente.

Principais Funcionalidades:
• Acesso mais seguro com seu e-mail e senha ou se preferir basta entrar com sua conta do Facebook;
• Mantenha todos seus cartões centralizados em um único cadastro e edite suas informações direto pelo App;
• Consulte o saldo, consumo médio e próximo crédito;
• Realize o Bloqueio temporário do cartão*;
• Solicite a 2ª via** do cartão através do autoatendimento*;
• Saiba onde foram os últimos estabelecimentos que utilizou seu benefício;
• Consulte a nossa rede credenciada.

INFORMAÇÕES IMPORTANTES:
• Este App necessita de conexão com a internet;
• Por razão de desempenho e segurança mantenha seu App Ticket sempre atualizado;
• Cadastre seus cartões apenas nos aplicativos oficiais da Ticket;
• E não se esqueça de avaliar o nosso aplicativo! A sua opinião é muito importante para que possamos melhorá-lo cada vez mais!
* Serviço disponível para os produtos: Ticket Cultura®, Ticket Alimentação®, Ticket Restaurante® e Ticket Flex®.
** Segunda via entregue no RH da sua empresa, serviço disponível para os produtos: Ticket Cultura®, Ticket Alimentação®, Ticket Restaurante®, Ticket Plus® e Ticket Flex®;
