O Aiboo é um aplicativo de delivery de comidas. Com ele você pode:

- Visualizar os melhores estabelecimentos e seus cardápios direto do aplicativo;
- Fazer seu pedido rapidamente, dispensando o trabalho de ter que ligar para o estabelecimento;
- Receber notificações do andamento de seu pedido;
- Recebê-lo em casa poucos minutos depois.

Quer saber como funciona? É simples:

1 - Digite a sua localização para encontrar estabelecimentos com serviço de delivery em sua região;
2 - Escolha o estabelecimento desejado e faça o seu pedido pelo aplicativo;
3 - Seu pedido será enviado diretamente ao estabelecimento;
4 - Pronto! Só aguardar. Enviaremos uma notificação quando o pedido estiver pronto e à caminho ;)

* Não há taxas extras pelo uso do aplicativo. O Aiboo é 100% gratuito e sempre será.

1º Defina a forma de receber sua pizza
